унаречено скрытой долей круга. Пример: в круге с центром на обозначенном месте и радиусом a лежит глубокая начинка N, направленная в сторону, к одной из очередей квадрата. Длина стороны N во второй очереди квадрата равна a.

Попробуйте найти выражение для данной задачи.

```js
const area = () => {
  const { radius } = prompt('Введите радиус круга: ');
  const { length } = prompt('Введите длину точки N из текста задачи: ');
  return Math.PI * Math.pow(radius, 2) * length / 2;
};

area();
```

